import React from 'react';
import { Card, CardBody, CardImg, CardTtitle, CardImgOverlay } from 'reactstrap';

const MenuItem = (props) => {
    console.log(props);
    return(
        <div>
            <Card>
                <CardBody>
                    <CardImg width="100%" alt={props.name} src={props.image}/>

                    <CardImgOverlay>
                        <CardTtitle></CardTtitle>
                    </CardImgOverlay>
                </CardBody>
            </Card>
        </div>
    );
}

export default MenuItem;
